import React from 'react'
import StoryCell from '../components/StoryCell'

const Stories = () => {
  return (
    <div className='Stories'>
    { this.props.stories.map(story =>
      <StoryCell
        key={story.id}
        story={story}
        handleClick={this.props.handleClick}
      />)
    }    </div>
  )
}

export default Stories
